const redTheme = {
	colors: {
		background: '#505050',
		opposite: '#ffffff',

		Primary: '#A75B5B',
		Secondary: '#E37272',
		Tertiary: '#FF8D8D',
		Quaternary: '#FFBEBE',
		Quinary: '#FFECEC',
	},
};

export default redTheme;
